import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './ProfilePage.css';

const ProfilePage = () => {
  const navigate = useNavigate();
  const email = localStorage.getItem("userEmail");
  const [user, setUser] = useState(null);
  const [editMode, setEditMode] = useState(false);
  const [form, setForm] = useState({ name: '', role: '' });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    if (!email) {
      setError('No email found in localStorage');
      setLoading(false);
      return;
    }

    fetch(`http://localhost:8081/api/auth/${email}`)
      .then(res => {
        if (!res.ok) throw new Error("Failed to fetch user");
        return res.json();
      })
      .then(data => {
        setUser(data);
        setForm({ name: data.name, role: data.role });
        setLoading(false);
      })
      .catch(err => {
        console.error(err);
        setError('Failed to load profile.');
        setLoading(false);
      });
  }, [email]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  const handleUpdate = async () => {
    try {
      const res = await fetch(`http://localhost:8081/api/auth/${email}`, {
        method: 'PUT',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ ...user, ...form }),
      });

      if (res.ok) {
        alert('Profile updated successfully');
        setEditMode(false);
        setUser(prev => ({ ...prev, ...form }));
      } else {
        alert('Update failed');
      }
    } catch (err) {
      alert('Server error');
      console.error(err);
    }
  };

  const handleCancel = () => {
    setForm({ name: user.name, role: user.role });
    setEditMode(false);
  };

  const handleBack = () => {
    navigate('/'); // Change path as needed
  };

  if (loading) return <p className="profile-loading">Loading profile...</p>;
  if (error) return <p className="profile-error">{error}</p>;

  return (
    <div className="profile-container">
      <h2 className="profile-title">User Profile</h2>

      <div className="profile-field email">
        <strong>Email:</strong> {user.email}
      </div>

      {editMode ? (
        <div className="edit-form">
          <div className="form-group">
            <label className="form-label name-label">Name:</label>
            <input
              className="form-input"
              name="name"
              value={form.name}
              onChange={handleChange}
              placeholder="Enter your name"
            />
          </div>

          <div className="form-group">
            <label className="form-label role-label">Role:</label>
            <select
              className="form-select"
              name="role"
              value={form.role}
              onChange={handleChange}
            >
              <option value="CLIENT">Client</option>
              <option value="FREELANCER">Freelancer</option>
            </select>
          </div>

          <button className="btn save-btn" onClick={handleUpdate}>
            Save Changes
          </button>
          <button className="btn cancel-btn" onClick={handleCancel}>
            Cancel
          </button>
        </div>
      ) : (
        <div className="view-mode">
          <div className="profile-field name">
            <strong>Name:</strong> {user.name}
          </div>
          <div className="profile-field role">
            <strong>Role:</strong> {user.role}
          </div>
          <button className="btn edit-btn" onClick={() => setEditMode(true)}>
            Edit Profile
          </button>
        </div>
      )}

      <button className="btn back-btn" onClick={handleBack}>
        ‚Üê Back to Home
      </button>
    </div>
  );
};

export default ProfilePage;
